import React from "react";
import "./style.css";
import "../../../box-style.css"
import {socials} from "../../../data/socials.js"

export default function Contact() {
  console.log({socials})
  return (<div className="anchor-box"><a name="contact" href="/#">&nbsp;</a>

    <div id="project-container" className="box">
      <div id="project-box">
        <h1 id="project-h1">Get In Touch</h1>
        <p>
          I'm always happy to hear from people who love to code, and I'm excited about the new direction my life is taking. Get in touch via the following:
        </p>
        <ul>

        {socials.map((item)=>{
          return <li>{item}</li>
        })}
        </ul>

      </div>
    </div>
    </div>
  );
}
